import React from 'react';
import classes from './People.module.css';

function People() {
  return (
    <section className={classes.people}>
      <h2>People</h2>
      <p>Health and Safety supersede everything else - a belief that we stand by and an ecosystem we foster at AM/NS India.</p>
    </section>
  );
}

export default People;
